contract Examples{
    bool myvar1=true;
    bool myvar2=true;
    bool myvar3=true;

    mapping(uint=>bool) public Mybool;
    mapping(address=>bool) public MyAddressMapping;

    function SetValue(uint _index) public{
        Mybool[_index]=false;
    }
    function getAddress() public {
        MyAddressMapping[msg.sender]=false;
    }
}

